    false,nt"url": null,nt"notes": "This report contains locations and water
    use at Browns Park NWR for 2006. After the creation of the Flaming Gorge Dam, the
    annual flooding of the Green River ceased to happen naturally. Browns Park NWR uses
    surface water from the Green River and Beaver Creek to fill impoundments, maintain
    riparian vegetation, and irrigate meadows to provide wildlife food, cover, and habitat.
    Pumps located on the Green River, are used to maintain marshes and bottomlands of
    approximately 1,142 surface acres. Additionally, diversions from Beaver Creek are
    used to maintain another 3 acres of impoundments and irrigate another 206 acres
    of meadow. Tabulated data for each specific ditch is provided which includes: adjudicated
    storage, the marsh unit it serves, the max surface AC, and the actual AF use for
    2006. Lastly each marsh unit highlighted to provide dates of pumping, the total
    AF pumped for that feature in 2006, and a proposed plan for 2007.",nt"owner_org":
